import styled from "styled-components";
import { LIElement, LinkContainer, ULElement } from "../Header/style";
import Logo from "../Logo/index";

const HeaderContainer = styled.header`
  width: 100%;
  height: 100%;
  margin: 0;
`;

const LogoContainer = styled.div`
  display: flex;
  padding: 7px;
  display: flex;
  align-items: center;
`;

const ListContainer = styled.div`
  margin-left: 15px;
`;

function Index() {
  return (
    <>
      <HeaderContainer>qweqwe</HeaderContainer>
    </>
  );
}

export default Index;
